import React, { useState } from 'react';

const FormDisplay = () => {
  const [status, setStatus] = useState('Idle');
  const [responseData, setResponseData] = useState(null);

  const createContainer = async () => {
    setStatus('üöÄ Creating container...');
    setResponseData(null);

    try {
      const response = await fetch('http://localhost:3001/proxy/rest/container', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          name: 'Test Container from UI',
          label: 'event_data',
          description: 'This container was created from the UI via proxy.',
        }),
      });

      const raw = await response.text();

      if (!response.ok) {
        console.error('‚ùå Raw error response:', raw);
        throw new Error(`Failed with ${response.status}: ${response.statusText}`);
      }

      const data = JSON.parse(raw);
      console.log('‚úÖ Container created:', data);

      setStatus(`‚úÖ Container created! ID: ${data.id ?? 'unknown'}`);
      setResponseData(data);
    } catch (err) {
      console.error('‚ùå Container creation failed:', err);
      setStatus(`‚ùå Error: ${err.message}`);
    }
  };

  return (
    <div style={{ padding: '2rem', fontFamily: 'Arial, sans-serif', maxWidth: '600px' }}>
      <h2>üîß Create Test Container</h2>
      <button
        onClick={createContainer}
        style={{
          padding: '10px 20px',
          fontSize: '16px',
          backgroundColor: '#007bff',
          color: '#fff',
          border: 'none',
          borderRadius: '6px',
          cursor: 'pointer',
        }}
      >
        Create Container
      </button>

      <p style={{ marginTop: '1rem', fontWeight: 'bold' }}>Status: {status}</p>

      {responseData && (
        <pre
          style={{
            background: '#f4f4f4',
            padding: '1rem',
            borderRadius: '6px',
            overflowX: 'auto',
            marginTop: '1rem',
          }}
        >
          {JSON.stringify(responseData, null, 2)}
        </pre>
      )}
    </div>
  );
};

export default FormDisplay;
